import React, { Component } from 'react';
import Logo from './logo.js';

import './newAccountGeneral.css';


class NewAccoutGeneral extends Component {
    constructor(props) {
        super(props);
        this.state = {
            username: '',
            password: '',
        };
    }

    handleInputChange = (event) => {
        const { name, value } = event.target;
        this.setState({ [name]: value });
    }

    handleSubmit = (event) => {
        event.preventDefault();

        //서버로 데이터 보냄
        alert('hi');

        //console.log('아이디:', this.state.username); 실제 웹 콘솔
        //console.log('비밀번호:', this.state.password);
    }


    render(){
    return (
        <div>
            <Logo/>
            <h2>일반회원가입</h2>
            <div className="회원가입정보">
                <form>
                    <div className ="회원가입정보한칸">
                        <p>아이디</p>
                        <div>
                            <div>
                            <input
                            type="text"
                            id="username"
                            name="username"
                            placeholder='아이디를 입력하세요'
                            value={this.state.username}
                            onChange={this.handleInputChange}
                            required/>
                            <button>중복체크</button>
                            </div>
                            <p></p>
                        </div>
                    </div>
                    <div>비밀번호</div>
                    <div>이름</div>
                    <div>전화번호</div>
                    <div>이메일</div>
                </form>
            </div>
        </div>
    );
}
}

export default NewAccoutGeneral;
